  false,\n\t\"url\": null,\n\t\"notes\": \"NODC accession 0103975 includes physical
  and underway data collected aboard the ENDEAVOR during cruise EN497 in the Gulf
  of Mexico from 2011-07-30 to 2011-08-19. These data include CURRENT SPEED - EAST/WEST
  COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT (V). The instruments used
  to collect these data include ADCP and GPS. These data were collected by UNIVERSITY
  OF RHODE ISLAND; GRADUATE SCHOOL OF OCEANOGRAPHY as part of Continental Shelf Diagenesis
  II: Coastal Iron Supply. The Lamont-Doherty Earth Observatory (LDEO) submitted these
  data to NODC as part of the NSF sponsored Rolling Deck to Repository (R2R) program.
  The ADCP data represent the raw and automated processed data set. Post processed
  quality assessed data are not available in this accession.\",\n\t\"owner_org\":
